      var newsEvents;
      
      function newsResetEvents() {
      	newsEvents = {

      		"gallerySwipe": 0,
      		"custom1": 0,
      		"custom1Name": "",
      		"custom2": 0,
      		"custom2Name": "",
      		"custom3": 0,
      		"custom3Name": ""
      	};
      }
      
      newsResetEvents();
      
      function newsVideoStart() {
      	newsEvents.videoStart = newsEvents.videoStart + 1;
      }
      
      function newsVideoStop() {
      	newsEvents.videoStop = newsEvents.videoStop + 1;
      }
      
      function newsGallerySwipe() {
      	newsEvents.gallerySwipe = newsEvents.gallerySwipe + 1;
      }
      
      function newsCustom1(name) {
      	if (newsEvents.custom1Name == "") {
      		newsEvents.custom1Name = name;
      	}
      	newsEvents.custom1 = newsEvents.custom1 + 1;	
      }
      
      function newsCustom2(name) {
      	if (newsEvents.custom2Name == "") {
      		newsEvents.custom2Name = name;
      	}
      	newsEvents.custom2 = newsEvents.custom2 + 1;	
      }
      
      function newsCustom3(name) {
      	if (newsEvents.custom3Name == "") {
      		newsEvents.custom3Name = name;
      	}
      	newsEvents.custom3 = newsEvents.custom3 + 1;	
      }
      
      function newsCollectEvents() {
      	var result = [];
      	if (newsEvents.videoStart > 0) {
      		result.push("eventX3=" + newsEvents.videoStart);
      	}
      	if (newsEvents.videoStop > 0) {
      		result.push("eventX4=" + newsEvents.videoStop);
      	}
      	if (newsEvents.gallerySwipe > 0) {
      		result.push("eventX5=" + newsEvents.gallerySwipe);
      	}
      	if (newsEvents.custom1 > 0) {
      		result.push("eVarX2=" + newsEvents.custom1Name);
      		result.push("propX2=" + newsEvents.custom1Name);
      		result.push("eventX6=" + newsEvents.custom1);
      	}
      	if (newsEvents.custom2 > 0) {
      		result.push("eVarX3=" + newsEvents.custom2Name);
      		result.push("propX3=" + newsEvents.custom2Name);
      		result.push("eventX7=" + newsEvents.custom2);
      	}
      	if (newsEvents.custom3 > 0) {
      		result.push("eVarX4=" + newsEvents.custom3Name);
      		result.push("propX4=" + newsEvents.custom3Name);
      		result.push("eventX8=" + newsEvents.custom3);
      	}
      	newsResetEvents();
